    var dropdownMenu = jQuery("a:visible + [id='hostMeetingDropdown']");
    //console.warn('opt - 2');
    jQuery(document).on("click", "a[href^='javascript']", function (event) {
        event.preventDefault()
    });
    //console.warn('opt - 3');
    //remove hover to open nav
    //if (jQuery('.optToggleMainMenu').length && !("ontouchstart" in document.documentElement)) {
    if (false){
        //console.warn('opt - 4');
        var mousePos = {
            x: 0,
            y: 0
        };
        jQuery(document).on("mousemove", function (event) {
            mousePos.x = event.pageX;
            mousePos.y = event.pageY
        });
        function mouseInside(target) {
            var offset = target.offset();
            if (mousePos.x > offset.left && mousePos.x < offset.left + target.outerWidth() && mousePos.y > offset.top && mousePos.y < offset.top + target.outerHeight()) {
                return true
            }
            return false
        }
        function closeDropdownIf(btn, drp) {
            window.setTimeout(function () {
                if (mouseInside(btn) || mouseInside(drp)) {
                    return
                }
                btn.parent().removeClass("open")
            }, 500)
        }
        function closeImmediatenIf(btn) {
            btn.parent().removeClass("open")
        }
        //console.warn('opt - 5');
        jQuery('.optToggleMainMenu').on("mouseenter", function () {
            //console.warn('opt - will open');
            if (window.innerWidth > optMaxWidth) {
                jQuery('.optMainNavItem').removeClass('open');
                jQuery(this).parent().addClass("open");
                if (jQuery("#hostmeeting-menu-item").hasClass("open")) {
                    jQuery("#hostmeeting-menu-item").removeClass("open")
                }
            }
        }).on("mouseleave", function () {
            if (window.innerWidth > optMaxWidth) {
                //  console.warn('opt - mouse leave');
                closeDropdownIf(jQuery(this), jQuery(this).next('.optToggleSubMenu'));
            }
        });
        //console.warn('opt - 6');
        jQuery('.optToggleSubMenu').on("mouseleave", function () {
            if (window.innerWidth > optMaxWidth) {
                // console.warn('opt - mouse leave');
                closeDropdownIf(jQuery(this).prev('.optToggleMainMenu'), jQuery(this));
            }
        });


        //top right bar
        btnHost.on("mouseenter", function () {
            if (window.innerWidth > optMaxWidth) {
                //closeImmediatenIf(btnMutipleJoin);
                btnHost.parent().addClass("open");
            }
        }).on("mouseleave", function () {
            if (window.innerWidth > optMaxWidth) {
                closeDropdownIf(btnHost, dropdownMenu)
            }
        });
        dropdownMenu.on("mouseleave", function () {
            if (window.innerWidth > optMaxWidth) {
                closeDropdownIf(btnHost, dropdownMenu)
            }
        });
        //console.warn('opt - 7');
    }

    //mobile set body overflow hidden
    utils.waitForElement('#navbar').then(function (nav) {
        var observer = new MutationObserver(function (mutations) {
            console.log('opt - in observer');
            observer.disconnect();

            if (jQuery('#navbar').hasClass('in')){
                jQuery('body').addClass('optNavOpen');
            }
            else
                jQuery('body').removeClass('optNavOpen');

            observer.observe(targetNode, observerConfig);
        });
        var observerConfig = {
            attributes: true,
            childList: true,
            characterData: true,
            subtree: true
        };
        var targetNode = nav;
        observer.observe(targetNode, observerConfig);
    });

